package in.ashokit;

public class RectangleDimensionsV1 {

	private int length;
	private int width;
	
	public RectangleDimensionsV1(int length, int width) {
		// TODO Auto-generated constructor stub
		this.length = length;
		this.width = width;
	}

	public int getLength() {
		return length;
	}

	public void setLength(int length) {
		this.length = length;
	}

	public int getWidth() {
		return width;
	}

	public void setWidth(int width) {
		this.width = width;
	}
	
	

}
